#!/usr/bin/python3

"""
This file contains the binary representation for the icons used in the GUI
"""

def getIconDict():
   # print ("getIconDict")
   from PyQt5.QtCore import QByteArray
   from PyQt5.QtGui import QIcon, QPixmap
   iconsBase64 = {"window" : b""
               ,"zip" : b""
               ,"csv" : b""
               ,"output" : b""
               ,"process" : b""
               ,"exit" : b""
               ,"image" : b""
               }

   icons = {}

   for key, value in iconsBase64.items():
       theDict = {}
       # print (key)
       thePixmap =  QPixmap()
       thePixmap.loadFromData(QByteArray.fromBase64(value))
       if key == "image": # image uses the pixmap. the rest use the icon
         theDict["pixmap"] = thePixmap
       else:
          theDict["icon"]  = QIcon(thePixmap)
       icons[key]          = theDict
       thePixmap           = None
       theDict             = None

   iconsBase64 = None
   # print (icons)
   # for key, value in icons.items():
      # print (key)

   return icons